  height: 100%;
  display: flex;
  flex-direction: column;
  align-items: center;
  background-color: green;
  color: white;
`;

export const SubAboutStyle = styled.h1`
  width: 80%;
  height: 100%;
  display: flex;
  flex-direction: column;
  align-items: start;
  background-color: orange;
  color: white;
`;

export const AboutTextStyle = styled.h1`
  width: 50%;
  height: 100%;
  display: flex;
  flex-direction: column;
  align-items: start;
  background-color: orange;
